import iconTrash from '../assets/iconTrash.png'

function CustomForm({type, placeholder, onChange, deleteButton = false}) {
  if (deleteButton)
  return (
    <form className="">
      <div className="rounded-xl border-4">
        <label className='flex flex-row'>
          <input
                type={type}
                placeholder={placeholder}
                className='px-[24px] text-left rounded-xl h-[50px] w-[100%] text-base font-inter focus:outline-0'
                onChange={onChange}
                />  
          <button className="pr-[24px]">
            <img src={iconTrash} alt='icon trash' className='w-[35px] h-[35px]'/>
          </button>
        </label>
      </div>
    </form>
  );
}

export default CustomForm;
